import React, { Component } from "react";
import TutorialDataService from "../src/services/tutorial.service";
//editar tutorial pero sin poder cambiar el id

export default class Tutorial extends Component {
    render() {

        return (
        <div>
            <h2>Edit Tutorial</h2>
            <form onSubmit={this.addTutorial}>
                    <div className="form-group">
                        <label htmlFor="title">Title</label>
                        <input
                            type="text"
                            className="form-control"
                            id="title"
                            name="title"
                            value={this.state.title}
                            onChange={this.handleInputChange}
                            required
                        />
                    </div>
                    <div className="form-group">
                        <label htmlFor="description">Description</label>
                        <input
                            type="text"
                            className="form-control"
                            id="description"
                            name="description"
                            value={this.state.description}
                            onChange={this.handleInputChange}
                            required
                        />
                    </div>
                    <div className="form-group">
                        <input
                            type="checkbox"
                            id="published"
                            name="published"
                            checked={this.state.published}
                            onChange={this.handleInputChange}
                        />
                        <label htmlFor="published">Published</label><br />
                    </div>
                    <div className="form-group">
                        <button type="submit" className="btn btn-success" onClick={this.addTutorial}>
                            Submit
                        </button>
                    </div>
                </form>
        </div>
        );
    }
}
